//   useEffect(() => {
//     checked && localStorage.removeItem("token");
//   });

  const handleLogout = () => {
    localStorage.removeItem("token");
    history.push("/login");
  };

  return (
    <Box>
      <button className={classes.logOutBtn} onClick={handleLogout}>
        <p className={classes.logOut}> Logout</p>
      </button>
    </Box>
  );
}

